-- ----------------------------
-- Table structure for cms_enewsclass
-- ----------------------------
DROP TABLE IF EXISTS `cms_enewsclass`;
CREATE TABLE `cms_enewsclass` (
  `classid` varchar(48) NOT NULL COMMENT '栏目ID',
  `bclassid` varchar(48) NOT NULL COMMENT '父栏目ID',
  `classname` varchar(50) DEFAULT NULL COMMENT '栏目名称',
  `sonclass` mediumtext COMMENT '终极栏目ID集合',
  `is_zt` tinyint(1) DEFAULT NULL COMMENT '预定义字段，暂时用不到，默认值0',
  `lencord` smallint(6) DEFAULT NULL COMMENT '每页显示信息数',
  `link_num` tinyint(4) DEFAULT NULL COMMENT '相关链接数',
  `newstempid` varchar(48) DEFAULT NULL COMMENT '内容模板ID',
  `onclick` int(11) DEFAULT NULL COMMENT '点击数',
  `listtempid` varchar(48) DEFAULT NULL COMMENT '列表模板ID',
  `featherclass` mediumtext COMMENT '父栏目ID集合',
  `islast` tinyint(1) DEFAULT NULL COMMENT '是否终极栏目,1为终极栏目，0为非终极栏目',
  `classpath` mediumtext COMMENT '栏目存放目录',
  `classtype` varchar(10) DEFAULT NULL COMMENT '栏目文件扩展名',
  `newspath` varchar(20) DEFAULT NULL COMMENT '内容页日期目录形式',
  `filename` tinyint(1) DEFAULT NULL COMMENT '内容页文件命名形式',
  `filetype` varchar(10) DEFAULT NULL COMMENT '内容页文件扩展名',
  `openpl` tinyint(1) DEFAULT NULL COMMENT '是否开启评论0为开启，1为关闭',
  `openadd` tinyint(1) DEFAULT NULL COMMENT '是否开放投稿0为开启，1为关闭',
  `newline` int(11) DEFAULT NULL COMMENT '最新信息JS显示数',
  `hotline` int(11) DEFAULT NULL COMMENT '热门信息JS显示数',
  `goodline` int(11) DEFAULT NULL COMMENT '推荐信息JS显示数',
  `classurl` varchar(200) DEFAULT NULL COMMENT '栏目绑定域名',
  `groupid` varchar(48) DEFAULT NULL COMMENT '默认内容页查看权限',
  `myorder` smallint(6) DEFAULT NULL COMMENT '排序',
  `filename_qz` varchar(20) DEFAULT NULL COMMENT '内容文件名前缀',
  `modid` varchar(48) DEFAULT NULL COMMENT '所属系统模型ID',
  `checked` tinyint(1) DEFAULT NULL COMMENT '信息默认是否审核,1为直接审核，0为未审核',
  `firstline` tinyint(4) DEFAULT NULL COMMENT '头条信息JS显示数',
  `bname` varchar(50) DEFAULT NULL COMMENT '栏目别名',
  `searchtempid` varchar(48) DEFAULT NULL COMMENT '搜索模板ID',
  `tid` varchar(48) DEFAULT NULL COMMENT '数据表ID',
  `tbname` varchar(60) DEFAULT NULL COMMENT '数据表名',
  `maxnum` int(11) DEFAULT NULL COMMENT '显示总记录数',
  `checkpl` tinyint(1) DEFAULT NULL COMMENT '评论是否需要审核1为要审核，0为直接通过',
  `down_num` tinyint(4) DEFAULT NULL COMMENT '每行下载地址数',
  `online_num` tinyint(4) DEFAULT NULL COMMENT '每行在线观看地址数',
  `listorder` varchar(50) DEFAULT NULL COMMENT '管理信息排序方式默认：id DESC',
  `classimg` varchar(255) DEFAULT NULL COMMENT '栏目缩略图',
  `addinfofen` int(11) DEFAULT NULL COMMENT '前台投稿加点数',
  `listdt` tinyint(1) DEFAULT NULL COMMENT '列表模式,0为静态列表，1为动态列表',
  `showclass` tinyint(1) DEFAULT NULL COMMENT '是否显示到导航0为显示，1为不显示',
  `showdt` tinyint(1) DEFAULT NULL COMMENT '内容页模式0为静态页面，1为动态生成，2为动态页面',
  `checkqadd` tinyint(1) DEFAULT NULL COMMENT '前台投稿是否要审核0为要审核，1为直接通过',
  `qaddlist` tinyint(1) DEFAULT NULL COMMENT '投稿生成列表0为不生成，1为生成当前栏目，2为生成首页，3为生成父栏目，4为生成当前栏目与父栏目，5为生成父栏目与首页，6为生成当前栏目、父栏目与首页',
  `qaddgroupid` varchar(48) DEFAULT NULL COMMENT '投稿权限多个会员组ID用“,”半角逗号隔开，例如：,1,2,3,',
  `qaddshowkey` tinyint(1) DEFAULT NULL COMMENT '投稿是否开启验证码1为开启，0为关闭',
  `adminqinfo` tinyint(1) DEFAULT NULL COMMENT '管理投稿0为不能管理信息，1为可管理未审核信息，2为只可编辑未审核信息，3为只可删除未审核信息，4为可管理所有信息，5为只可编辑所有信息，6为只可删除所有信息',
  `doctime` smallint(6) DEFAULT NULL COMMENT '信息归档时间',
  `classpagekey` varchar(255) DEFAULT NULL COMMENT '页面关键字',
  `dtlisttempid` varchar(48) DEFAULT NULL COMMENT '动态列表模板ID',
  `classtempid` varchar(48) DEFAULT NULL COMMENT '封面模板ID',
  `nreclass` tinyint(1) DEFAULT NULL COMMENT '是否生成栏目页0为生成，1为不生成',
  `nreinfo` tinyint(1) DEFAULT NULL COMMENT '是否生成内容页0为生成，1为不生成',
  `nrejs` tinyint(1) DEFAULT NULL COMMENT '是否生成JS调用0为生成，1为不生成',
  `nottobq` tinyint(1) DEFAULT NULL COMMENT '标签是否调用0为调用，1为不调用',
  `ipath` varchar(255) DEFAULT NULL COMMENT '自定义内容页存放目录',
  `addreinfo` tinyint(1) DEFAULT NULL COMMENT '发布信息生成内容页1为生成，0为不生成 (后台)',
  `haddlist` tinyint(4) DEFAULT NULL COMMENT '发布生成列表0为不生成，1为生成当前栏目，2为生成首页，3为生成父栏目，4为生成当前栏目与父栏目，5为生成父栏目与首页，6为生成当前栏目、父栏目与首页 (后台)',
  `sametitle` tinyint(1) DEFAULT NULL COMMENT '是否检测标题重复0为不检测，1为检测',
  `definfovoteid` varchar(48) DEFAULT NULL COMMENT '信息预设投票ID',
  `wburl` varchar(255) DEFAULT NULL COMMENT '外部栏目链接地址',
