  `dotemp` tinyint(1) DEFAULT NULL COMMENT '是否为模板项，值0',
  `tid` varchar(48) DEFAULT NULL COMMENT '数据表ID',
  `tbname` varchar(60) DEFAULT NULL COMMENT '数据表名',
  `savetxt` tinyint(1) DEFAULT NULL COMMENT '是否内容存文本，1为存文本，0为普通字段',
  `fvalue` text COMMENT '字段初始值，多个值之间用“|”分隔，如：福建|北京',
  `iskey` tinyint(1) DEFAULT NULL COMMENT '是否为索引字段，1为加索引，0为不加索引',
  `tobr` tinyint(1) DEFAULT NULL COMMENT '内容回车替换成换行符，1为替换，0为不替换',
  `dohtml` tinyint(1) DEFAULT NULL COMMENT '内容支持html代码，1为支持，0为不支持',
  `qfhtml` mediumtext COMMENT '投稿表单替换html代码',
  `isonly` tinyint(1) DEFAULT NULL COMMENT '字段值是否唯一，1为唯一，0为不限',
  `tbdataf` int(4) DEFAULT NULL COMMENT '是否为副表字段，0为主表，1为副表1，2为副表2，3为副表3',
  `ispage` tinyint(1) DEFAULT NULL COMMENT '是否分页字段，1为分页字段，0为普通字段',
  `issmalltext` tinyint(1) DEFAULT NULL COMMENT '是否简介字段，1为简介字段，0为普通字段',
  `organization` varchar(30) DEFAULT '所属机构',
  `jsonstring` varchar(200) DEFAULT NULL,
  `associate` tinyint(1) DEFAULT NULL,
  `maxlength` varchar(255) DEFAULT NULL COMMENT '最大长度',
  `minlength` varchar(255) DEFAULT NULL COMMENT '最小长度',
  `inhibiting` varchar(255) DEFAULT NULL COMMENT '输入约束（正则表达式）',
  PRIMARY KEY (`fid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

