INSERT INTO `zjxx_enewsf` VALUES ('c299d821-be2b-4897-bd99-3a002ec6323c', 'title', '标题', 'title', '\r\n<div class=\"form-group has-success\" style=\"margin:0px;\">\r\n	<div class=\"col-xs-12 col-sm-5\">\r\n		<span class=\"block input-icon input-icon-right\">\r\n			<input type=\"text\" id=\"title\" name=\"title\" class=\"width-100\">\r\n		</span>\r\n	</div>\r\n	<div style=\"float:left;margin-top:4px\">\r\n		<button type=\"button\" class=\"btn btn-xs\" >图文</button>\r\n	</div>\r\n	<div style=\"float:left;margin-left:10px\">\r\n		<span class=\"bigger-110\">属性:</span>\r\n		<div class=\"inline\">\r\n			<label>\r\n				<input name=\"title_font\" value=\"0\" type=\"checkbox\" class=\"ace\">\r\n				<span class=\"lbl\">粗体</span>\r\n			</label>\r\n		</div>\r\n		<div class=\"inline\">\r\n			<label>\r\n				<input name=\"title_font\" value=\"1\" type=\"checkbox\" class=\"ace\">\r\n				<span class=\"lbl\">斜体</span>\r\n			</label>\r\n		</div>\r\n		<div class=\"inline\">\r\n			<label>\r\n				<input name=\"title_font\" value=\"2\" type=\"checkbox\" class=\"ace\">\r\n				<span class=\"lbl\">删除线</span>\r\n			</label>\r\n		</div>\r\n		<span class=\"bigger-110\" style=\"margin-left:10px\">颜色:</span>\r\n		<div class=\"inline\">\r\n			<input class=\"input-medium input-mask-eyescript\" type=\"text\" name=\"title_color\" id=\"title_color\">\r\n		</div>\r\n	</div>\r\n</div>\r\n', '标题', '0', '1', '0', null, '0', 'varchar', '120', null, '295e06b1-4169-45e4-8be9-7c5749936df8', 'zjxx_problems', '0', '', '0', null, null, '\r\n<div class=\"form-group has-success\" style=\"margin:0px;\">\r\n	<div class=\"col-xs-12 col-sm-5\">\r\n		<span class=\"block input-icon input-icon-right\">\r\n			<input type=\"text\" id=\"title\" name=\"title\" class=\"width-100\">\r\n		</span>\r\n	</div>\r\n	<div style=\"float:left;margin-top:4px\">\r\n		<button type=\"button\" class=\"btn btn-xs\" >图文</button>\r\n	</div>\r\n	<div style=\"float:left;margin-left:10px\">\r\n		<span class=\"bigger-110\">属性:</span>\r\n		<div clas