-- ----------------------------
-- Table structure for zjxx_enewsfile
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_enewsfile`;
CREATE TABLE `zjxx_enewsfile` (
  `fileid` varchar(48) COLLATE utf8_unicode_ci NOT NULL COMMENT '附件id',
  `filename` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '附件名',
  `filetype` varchar(48) COLLATE utf8_unicode_ci DEFAULT NULL,
  `filesize` int(11) DEFAULT NULL COMMENT '附件的大小',
  `path` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '附件的相对路径',
  `adduser` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '上传者',
  `filetime` datetime DEFAULT NULL COMMENT '上传时间',
  `classid` smallint(6) DEFAULT NULL COMMENT '栏目id',
  `no` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件编号',
  `onclick` int(11) DEFAULT NULL COMMENT '下载数',
  `id` bigint(20) DEFAULT NULL COMMENT '信息id',
  `cjid` bigint(20) DEFAULT NULL COMMENT '文件临时识别编号',
  `md5` varchar(60) CHARACTER SET utf8 DEFAULT NULL COMMENT '文件的MD5值',
  `fid` varchar(48) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件的父id',
  `ftype` int(11) DEFAULT NULL COMMENT '文件的类型',
  PRIMARY KEY (`fileid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

