-- ----------------------------
-- Table structure for zjxx_enewstable
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_enewstable`;
CREATE TABLE `zjxx_enewstable` (
  `tid` varchar(48) CHARACTER SET utf8 NOT NULL COMMENT '数据表ID',
  `tbname` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '数据表名',
  `tname` varchar(60) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '数据表标识',
  `tbtype` int(11) DEFAULT NULL COMMENT '表类型(1、基础信息表；2、栏目3、标签4、数据词典5、机构、6、人员；7角色8菜单)',
  `tbs` text COMMENT '和基础表的对应字段，用“，”隔开',
  `tsay` mediumtext CHARACTER SET utf8 COMMENT '备注',
  `ismaster` tinyint(1) DEFAULT NULL COMMENT '是否是主表(1为主表，0为分表)',
  `masterb` varchar(60) NOT NULL COMMENT '主表名称',
  `parenttb` varchar(48) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '父表名称',
  `sontb` mediumtext CHARACTER SET utf8 NOT NULL COMMENT '子表集合',
  `datatbs` varchar(250) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '分表集合',
  `torder` int(11) DEFAULT NULL COMMENT '顺序',
  `yhid` varchar(48) CHARACTER SET utf8 DEFAULT NULL COMMENT '使用优化方案ID',
  `orgid` varchar(48) CHARACTER SET utf8 DEFAULT NULL COMMENT '机构',
  PRIMARY KEY (`tid`)
) ENGINE=MyISAM DEFAULT CHARSET=gbk;

-- ----------------------------
-- Records of zjxx_enewstable
-- ----------------------------
