DROP TABLE IF EXISTS `zjxx_jcxx`;
CREATE TABLE `zjxx_jcxx` (
  `id` varchar(48) NOT NULL COMMENT '主键Id',
  `a_title` varchar(48) DEFAULT NULL COMMENT '标题',
  `a_ftitle` varchar(48) DEFAULT NULL COMMENT '副标题',
  `a_specialfield` varchar(100) DEFAULT NULL COMMENT '特殊属性',
  `a_newstime` varchar(120) DEFAULT NULL COMMENT '发布时间',
  `a_titlepic` varchar(120) DEFAULT NULL COMMENT '标题图片',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

