-- Table structure for zjxx_jp_data
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_jp_data`;
CREATE TABLE `zjxx_jp_data` (
  `data_id` varchar(48) CHARACTER SET utf8 NOT NULL COMMENT '主键id',
  `title` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `child_type` tinyint(4) DEFAULT NULL COMMENT '子表类型(1、基础信息表；2、栏目；3、标签；4、数据词典5、机构、6、人员；7角色；8菜单；9、分类信息；10、实体)',
