-- Table structure for zjxx_jp_data_dictionary
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_jp_data_dictionary`;
CREATE TABLE `zjxx_jp_data_dictionary` (
  `id` varchar(48) CHARACTER SET utf8 NOT NULL,
  `title` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `description` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `order_num` int(11) DEFAULT '0',
  `pid` varchar(48) CHARACTER SET utf8 DEFAULT NULL,
  `pids` text CHARACTER SET utf8 COMMENT '父亲的fids+自己的id',
  `cid` text CHARACTER SET utf8,
  `oids` text CHARACTER SET utf8 COMMENT '所属机构',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

