DROP TABLE IF EXISTS `zjxx_jp_dorg`;
CREATE TABLE `zjxx_jp_dorg` (
  `id` varchar(48) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '主键ID',
  `oid` varchar(48) CHARACTER SET utf8 DEFAULT NULL COMMENT '机构表ID',
  `did` varchar(48) CHARACTER SET utf8 DEFAULT NULL COMMENT '数据词典表ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

