-- Table structure for zjxx_jp_function
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_jp_function`;
CREATE TABLE `zjxx_jp_function` (
  `id` varchar(48) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键id',
  `title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '功能名称',
  `short_title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '功能名称简称',
  `english_title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '功能名称英文',
  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '功能描述',
  `menuid` varchar(48) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '菜单id',
  `picture` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片',
  `url` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '页面url',
  `page` text COLLATE utf8_unicode_ci COMMENT '页面',
  `rorder` int(11) DEFAULT '0',
  `hanzi` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

