-- Table structure for zjxx_jp_manager
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_jp_manager`;
CREATE TABLE `zjxx_jp_manager` (
  `id` varchar(48) CHARACTER SET utf8 NOT NULL COMMENT '管理员id',
  `token` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'token',
  `username` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '管理员名',
  `password` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '管理员密码',
  `type` int(11) DEFAULT NULL COMMENT '是否为超级管理员',
  `roles` text COLLATE utf8_unicode_ci COMMENT '管理员角色集合',
  `orgid` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

