-- ----------------------------
-- Table structure for zjxx_jp_menu
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_jp_menu`;
CREATE TABLE `zjxx_jp_menu` (
  `id` varchar(48) COLLATE utf8_unicode_ci NOT NULL COMMENT '菜单主键id',
  `title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '菜单名称',
  `short_title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '菜单名称简称',
  `english_title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '菜单名称英文',
  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '菜单描述',
  `is_final` tinyint(4) DEFAULT NULL COMMENT '是否为终极菜单',
  `pid` varchar(48) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '所属父级菜单',
  `chid` text COLLATE utf8_unicode_ci COMMENT '子级菜单',
  `orgid` varchar(48) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '机构id',
  `type` int(11) DEFAULT NULL COMMENT '类型',
  `picture` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片',
  `rorder` int(11) DEFAULT '0',
  `hanzi` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

