DROP TABLE IF EXISTS `zjxx_jp_people`;
CREATE TABLE `zjxx_jp_people` (
  `id` varchar(48) NOT NULL COMMENT '主键ID',
  `title` varchar(100) DEFAULT NULL COMMENT '姓名',
  `description` text COMMENT '描述',
  `account` varchar(32) DEFAULT NULL COMMENT '用户名',
  `password` varchar(32) DEFAULT NULL COMMENT '密码',
  `id_number` varchar(32) DEFAULT NULL COMMENT '身份证号',
  `email` varchar(24) DEFAULT NULL COMMENT '邮箱',
  `orgid` varchar(48) DEFAULT NULL COMMENT '所属机构',
  `r_time` varchar(60) DEFAULT NULL COMMENT '注册时间',
  `token` varchar(48) DEFAULT NULL COMMENT '登录标志',
  `t_time` datetime DEFAULT NULL COMMENT '产生tocken时间',
  `bid` mediumtext CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT '标签id',
  `rorder` int(11) DEFAULT NULL COMMENT '顺序',
  `linkruleid` varchar(48) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '转化规则ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

