-- Table structure for zjxx_model
-- ----------------------------
DROP TABLE IF EXISTS `zjxx_model`;
CREATE TABLE `zjxx_model` (
  `mid` varchar(48) NOT NULL COMMENT '模型ID',
  `mname` varchar(100) DEFAULT NULL COMMENT '模型名称',
  `mtemp` mediumtext COMMENT '录入表单模板',
  `mzs` varchar(255) DEFAULT NULL COMMENT '注释',
  `cj` mediumtext COMMENT '采集项',
  `enter` mediumtext COMMENT '录入项',
  `tempvar` mediumtext COMMENT '内容模板项',
  `sonclass` text COMMENT '终极栏目ID集合',
  `searchvar` varchar(255) DEFAULT NULL COMMENT '搜索项',
  `tid` varchar(48) DEFAULT NULL COMMENT '数据表ID',
  `tbname` varchar(60) DEFAULT NULL COMMENT '数据表名',
  `qenter` mediumtext COMMENT '投稿项',
  `mustqenterf` text COMMENT '必填项',
  `qmtemp` mediumtext COMMENT '前台投稿表单模板',
  `listandf` text COMMENT '结合项',
  `setandf` tinyint(1) DEFAULT NULL COMMENT '结合项匹配(0为完全匹配，1为模糊匹配)',
  `listtempvar` mediumtext COMMENT '列表模板项',
  `qmname` varchar(30) DEFAULT NULL COMMENT '模型别名',
  `canaddf` text COMMENT '可增加项',
  `caneditf` text COMMENT '可修改项',
  `definfovoteid` smallint(6) DEFAULT NULL COMMENT '信息预设投票ID',
  `showmod` tinyint(1) DEFAULT NULL COMMENT '是否显示到前台导航(1为显示，0为不显示)',
  `usemod` tinyint(1) DEFAULT NULL COMMENT '是否启用(1为开启，0为不使用)',
  `myorder` smallint(6) DEFAULT NULL COMMENT '排序',
  `orderf` text COMMENT '排序项',
  `isdefault` tinyint(1) DEFAULT NULL COMMENT '是否默认模型(1为默认，0为非默认)',
  `listfile` varchar(30) DEFAULT NULL COMMENT '信息列表名称',
  `printtempid` smallint(6) DEFAULT NULL COMMENT '打印模板ID',
  `orgid` varchar(48) DEFAULT NULL COMMENT '所属机构',
  `uk` mediumtext COMMENT '联合主键',
  `enterjson` mediumtext COMMENT '录入项类型',
  `relatedfield` text COMMENT '关联字段信息',
  `frontlist` mediumtext COMMENT '前端列表项',
  PRIMARY KEY (`mid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

