CREATE TABLE `zjxx_orgnization` (
  `id` varchar(48) NOT NULL DEFAULT '' COMMENT '主键ID',
  `title` varchar(100) DEFAULT NULL COMMENT '名称',
  `description` text COMMENT '描述',
  `parent_org` varchar(48) DEFAULT NULL COMMENT '父级机构',
  `legal_org` varchar(48) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '机构法人',
  `org_size` varchar(24) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '规模',
  `child_org` text COMMENT '子级机构',
  `create_date` date DEFAULT NULL COMMENT '创建日期',
  `org_address` varchar(255) DEFAULT NULL COMMENT '机构地址',
  `org_email` varchar(128) DEFAULT NULL COMMENT '机构邮箱',
  `org_phone` varchar(24) DEFAULT NULL COMMENT '机构电话',
  `isdelete` tinyint(1) DEFAULT '0' COMMENT '1删除 0未删除',
  `linkruleid` varchar(48) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '转化规则ID',
  `org_order` int(11) DEFAULT NULL COMMENT '顺序',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

